"""**EfficientNetv2B0**

İşlem yükü bakımından  efektif bir modeldir.Küçük modellerle daha iyi sonuçlar vermektedir.Bunu da derinlik, çözünürlük ve genişlik kavramlarını aynı anda ölçeklendirme yaparak başarabilmektedir.

EfficientV1 den yeni olarak Fused-MBConv katmanı kullanılmaktadır.

![image.png](data:image/png;base64,)

EfficientNetV2 mimarisi, ilk katmanlarda hem MBConv'u hem de yeni eklenen Fused-MBConv'u kapsamlı bir şekilde kullanır.

EfficientNetV2, EfficientNetV1'deki 5x5 yerine küçük 3x3 çekirdek boyutlarını tercih eder.

EfficientNetV2, EfficientNetV1'de  olduğu gibi son stride aşamasını tamamen kaldırır.

EfficientNetV1 ile karşılaştırıldığında, EfficientNetV2 mimarisi 6,8 kat daha küçükken 11 kata kadar daha hızlı eğitir.

**EfficentNetV2-S Mimarisi**

![image.png](data:image/png;base64,)
"""

efficient_net_base = tf.keras.applications.EfficientNetV2B0(
    include_top=False,
    weights="imagenet",
    input_shape=(224,224,3),
    pooling='max',
    classes=4,
    classifier_activation="softmax",
    
)

efficient_net_base.summary()

"""EfficentNet son 10 katmanını dondurup ekleme yaptım ancak beklediğim sonuçları alamadım daha sonra sadece son katmanına ekleme yaparak daha iyi sonuçlar aldım . Önce dense boyutunu ve sayısını arttırarak denedim ,aktivasyon fonksiyonlarını denedim . Öğrenme hızını yüksekten düşüğe doğru denedim . 
Regularizers L1 denedim ancak L2 yi daha başarılı buldum.Dropoutlar boyutlarıyla oynayarak ekledim.Her dense katmanından sonra batch normalizasyon ekledim

"""

efficient_net = tf.keras.Sequential([
        efficient_net_base,
        Dense(1024,kernel_regularizer=regularizers.l2(0.01), activation="relu"),
        BatchNormalization(),
        Dropout(0.6),
        Dense(512,kernel_regularizer=regularizers.l2(0.01), activation="relu"),
        BatchNormalization(),
        Dropout(0.6),
        Dense(128,activation="relu",kernel_regularizer=regularizers.l2(0.01)),
        BatchNormalization(),
        Dropout(0.4),
        Dense(64,activation="relu"),
        BatchNormalization(),
        Dropout(0.3),
        Dense(4,activation="softmax")
    ])

opt2 = Adamax(learning_rate=1e-4)#adamax daha ıyı sonuc verdi

efficient_net.compile(loss='categorical_crossentropy',optimizer=opt2,metrics=['accuracy'])

efficient_net.summary()

history=efficient_net.fit(
     trainGen,
     validation_data=valGen,
     epochs=30,
     batch_size=32,
)

score = efficient_net.evaluate(testGen)
print('Test loss:', score[0])
print('Test accuracy:', score[1])

import matplotlib.pyplot as plt

history_dict = history.history
