"""Model başta overfit  olsa da , droput ,data augment ,  regularizers ve batch normalization ile uygun hale gelmiştir . Sonuç olarak model yukarıda görüldüğü gibi overfit olmamıştır"""

import itertools


def plot_confusion_matrix(cm, classes, normalize=True, title='Confusion matrix', cmap=plt.cm.Blues):

    plt.figure(figsize=(10,10))
    plt.imshow(cm, interpolation='nearest', cmap=cmap)
    plt.title(title)
    plt.colorbar()
    tick_marks = np.arange(len(classes))
    plt.xticks(tick_marks, classes, rotation=45)
    plt.yticks(tick_marks, classes)
    if normalize:
        cm = cm.astype('float') / cm.sum(axis=1)[:, np.newaxis]
        cm = np.around(cm, decimals=2)
        cm[np.isnan(cm)] = 0.0
    thresh = cm.max() / 2.
    for i, j in itertools.product(range(cm.shape[0]), range(cm.shape[1])):
        plt.text(j, i, cm[i, j],
                 horizontalalignment="center",
                 color="white" if cm[i, j] > thresh else "black")
    plt.tight_layout()
    plt.ylabel('True label')
    plt.xlabel('Predicted label')

from sklearn.metrics import classification_report, confusion_matrix
import numpy as np


Y_pred = efficient_net.predict(testGen)
y_pred = np.argmax(Y_pred, axis=1)
target_names = classes


cm = confusion_matrix(testGen.classes, y_pred)
plot_confusion_matrix(cm, target_names, normalize=False, title='Confusion Matrix')
print('Classification Report')
print(classification_report(testGen.classes, y_pred, target_names=target_names))

print(confusion_matrix(testGen.classes, y_pred))
pd.DataFrame((classification_report(testGen.classes, y_pred, output_dict=True)))

"""**INCEPTIONV3**

Inception V3 bir tür konvolüsyonel nöral ağ modeli. Çok sayıda konvolüsyon ve maksimum havuzlama adımlarından oluşmakta. Son aşamada ise tam bağlı nöral ağ içeriyor.

Modelin kendisi, evrişimler, global  pooling, maksimum pooling, concatenate, dropout ve fc katmanları dahil olmak üzere simetrik ve asimetrik yapı taşlarından oluşur. Batch normalization, model boyunca yaygın olarak kullanılır ve aktivasyon girdilerine uygulanır. Kayıp, Softmax kullanılarak hesaplanır.

![image.png](data:image/png;base64,)
"""

InceptionV3_model = tf.keras.applications.InceptionV3(weights='imagenet', include_top=False, input_shape=(224, 224, 3))

inception_base_model  = tf.keras.applications.InceptionV3(
    include_top=False,
    weights='imagenet',
    input_shape=(224,224,3),
    pooling='max',
    classes=4

)

opt = SGD(learning_rate=1e-4, momentum=0.9)#learning rate küçültüp  ile oynayıp dene birde

"""Aslında ilk denemede iyi sonuç verdiği için  parametrelerle pek oynamadım ancak EfficientNet'te Adamax kullanırken burada farklı olarak SGD kullandım  .Eklediğim katmanlar dropout ,batchnormalization yani geriye kalan senaryo EfficentNet ile aynıdır


"""

inception_model = tf.keras.Sequential([
        inception_base_model,
        Dense(1024,kernel_regularizer=regularizers.l2(0.01), activation="relu"),
        BatchNormalization(),
        Dropout(0.6),
        Dense(512,kernel_regularizer=regularizers.l2(0.01), activation="relu"),
        BatchNormalization(),
        Dropout(0.6),
        Dense(128,activation="relu",kernel_regularizer=regularizers.l2(0.01)),
        BatchNormalization(),
        Dropout(0.4),
        Dense(64,activation="relu"),
        BatchNormalization(),
        Dropout(0.3),
        Dense(4,activation="softmax")
    ])

inception_model.compile(optimizer=opt,loss='categorical_crossentropy',metrics=['accuracy'])

inception_model.summary()

history_ınc=inception_model.fit(
    trainGen,
    validation_data=valGen,
    epochs=30,
    batch_size=32,
)

